    "{
  "partes_contratadas": [
    "S se compromete a fornecer os gêneros\n\nalimentícios da agricultura Familiar ao CONTRATANTE conforme\n\ndescrito no Projeto de Venda de Gêneros Alimentícios da Agricultura\n\nFamiliar, parte integrante deste Instrumento.\n\n\n\nCLÁSULA TERCEIRA:\nO limite individual de venda de gêneros alimentícios do Agricultor\n\nFamiliar e do Empreendedor Familiar Rural, nesse ato denominados\n\nCONTRATADOS será de até R$ 20.000,00 (Vinte mil reais) por\n\nDAP por ano civil, referente à sua produção, conforme a legislação do\n\nprograma Nacional de Alimentação Escolar.\n\n\n\nCLÁUSULA QUARTA:\nOS CONTRATADORES FORNECEDORES ou as ENTIDADES\n\nARTICULADORAS deverão informar ao ministério do\n\nDesenvolvimento Agrário",
    "receberá o valor de R$\n\n7.740,00 (SETE MIL SETECENTOS E QUARENTA REAIS).\n\n\n\nCLÁUSULA SÉTIMA:\nNo valor mencionado na cláusula sexta estão incluídas as despesas\n\ncom frete, recursos humanos e materiais, assim como os encargos\n\nfiscais, sociais, comerciais, trabalhistas e previdenciários e quaisquer\n\noutras despesas necessárias ao cumprimento das obrigações\n\ndecorrentes do presente contrato.\n\n\n\nCLÁUSULA OITAVA:\nAs despesas decorrentes do presente contrato correrão à conta das\n\nseguintes dotações orçamentárias: 20.500 SECRETARIA DE\n\nEDUCAÇÃO",
    "enquanto houver pendência\n\nde liquidação de obrigação financeira em virtude de penalidade ou\n\ninadimplência contratual.\n\n\n\nCLÁUSULA DÉCIMA:\nO CONTRATANTE, que não seguir a forma de liberação de recursos\n\npara pagamento do CONTRATANTE FORNECEDOR, deverá pagar\n\nmulta de 2%, mais juros de 0,1 % ao dia, sobre o valor da parcela\n\nvencida, ressalvados os casos quando não efetivados os repasses\n\nmensais de recursos do FNDE em tempo hábil.\n\n\n\nCLÁUSULA ONZE:\nO CONTRATADO FORNECEDOR deverá guardar pelo prazo de 05\n\n(cinco) anos, cópias das notas fiscais de vendas, ou congêneres, dos\n\nprodutos participantes do Projeto de Venda de Gêneros Alimentícios\n\nda Agricultura Familiar para Alimentação Escolar, estando à\n\ndisposição para comprovação.\n\n\n\nCLÁUSULA DOZE:\nO CONTRATANTE se compromete em guardar por 05 (cinco) anos\n\nas Notas Fiscais de Compras, os Termos de Recebimento,\n\napresentados nas prestações de contas, bem como o Projeto de Venda\n\nde Gêneros Alimentícios da Agricultura Familiar para Alimentação\n\nEscolar e documentos anexos, estando à disposição para\n\ncomprovação.\n\n\n\nCLÁUSULA TREZE:\nÉ de exclusiva responsabilidade do CONTRATADO FORNECEDOR\n\no ressarcimento de danos causados ao CONTRATANTE ou a\n\nterceiros, decorrentes de sua culpa ou dolo na execução do contrato,\n\nnão excluindo ou reduzindo esta responsabilidade à fiscalização.\n\n\n\nCLÁUSULA QUATORZE:\nO CONTRATANTE em razão de supremacia de interesses públicos\n\nsobre os interesses particulares poderá:\n\na. Modificar unilateralmente o contrato para melhor adequação às\n\nfinalidades de interesse público, respeitando os direitos do\n\nCONTRATADO;\n\nb. Rescindir unilateralmente o contrato, nos casos de infração\n\ncontratual ou inaptidão do CONTRATADO;\n\nc. Fiscalizar a execução do contrato;\n\nd. Aplicar sanções motivadas pela inexecução total ou parcial do\n\najuste.\n\nSempre que a CONTRATANTE alterar ou rescindir o contrato sem\n\nculpa do CONTRATADO, deve respeitar o equilíbrio econômico-\n\nfinanceiro, garantindo-lhe o aumento das remunerações respectivas ou\n\nda indenização por despesas já realizadas.\n\n\n\nCLÁUSULA QUINZE:\nA multa aplicada após regular processo administrativo poderá ser\n\ndescontada dos pagamentos eventualmente divididos pelo\n\nCONTRATANTE ou, quando for o caso, cobrada judicialmente.\n\n\n\nCLÁUSULA DEZESSEIS:\nA fiscalização do presente contrato ficará a cargo da Secretaria\n\nMunicipal da Educação, da Entidade Executora, do Conselho de\n\nAlimentação Escolar",
    "s, assinam o presente\n\ninstrumento em três vias iguais de igual teor e forma, na presença de\n\nduas testemunhas.\n\n\n\nPrefeitura Municipal de Água Branca (PB), 22 de março de 2021.\n\n\n\nPrefeitura Municipal de Água Branca\n\nEVERTON FIRMINO BATISTA\nPrefeito Constitucional\n\nContratante\n\n\n\nRITA IZABEL DA SILVA GUEDES"
